import React from 'react'
import Card from '../Components/Card';
import ProjectComplete from "../Components/Assets/images/ProjectComplete.svg";
import RunningProjects from "../Components/Assets/images/RunningProjects.svg";
import PipelineProjects from "../Components/Assets/images/Pipeline.svg";
import SupportRequired from "../Components/Assets/images/SupportRequired.svg";
import SubHeader from '../Components/SubHeader';


const Home = () => {

    const ProjectDetails = [{
        icon: ProjectComplete,
        status: "Project Completed",
        count: 0
    },
    {
        icon: RunningProjects,
        status: "Running Projects",
        count: 0
    },
    {
        icon:  PipelineProjects,
        status: "Pipeline Projects",
        count: 0
    },
    {
        icon:  SupportRequired,
        status: "Support Required",
        count: 0
    }


    ]

    return (
        <div>
        <div className='card'>
       {ProjectDetails && ProjectDetails.map((data)=>

            <Card  {...data}/>)}
            </div>

            <div>
                <SubHeader/>
            </div>
            </div>
    )


}
export default Home;
